/**扩展工具
 * ajax loading样式, 打开:load.open(),关闭:load.open();
 * @param text, 显示的加载文字
 * tag :父元素, 默认为body
 */
function load() {
}
load.$loading = null;
load.open = function( text,tag ) {
	if ( load.$loading )
		return;
	var $parentTag = ( typeof tag == "undefined" ? $("body") : $(tag) );
	var x = $parentTag.offset().left,y= $parentTag.offset().top;
	var w = $parentTag.outerWidth(true),h = $parentTag.outerHeight(true);
	var overlay = "<div style='height: "+h+"px; width: "+w+"px;left: "+x+"px;top:"+y+"px;background-color: #333;position: absolute; z-index: 99998;opacity:0.3;'></div>";
	var textW = text ? text.length * 12 + 50 : 105;
	var textX = x +( w / 2 - (textW / 2) );
	var textY = y +( $(window).height()/2 -150  );
	load.$loading = $( overlay + "<div style='height:42px; width:" + textW + "px;left: " + textX + "px;top:" + textY + "px;background-color: #FFF;position: fixed; z-index: 99999;border-radius: 8px;'><img style='left:5px;top:5px;position:absolute;' src='/bioec/pages/common/images/loading/xubox_loading2.gif'/> <span style='left:45px;top:12px;position:absolute;'>" + (text ? text : '加载中...') + "</span></div>" );
	$( "body" ).append( load.$loading );
};
load.close = function() {
	if ( load.$loading != null ) {
		load.$loading.remove();
		load.$loading = null;
	}
};

