/**
 * 
 ******************数组和对象的小工具方法 **************
 */

// 数组第一次出现指定元素值的位置
Array.indexOf = function( array, o ) {
	for ( var i = 0; i < array.length; i++ )
		if ( array[i] == o )
			return i;
	return -1;
};
/* 数组是否包含某个对象 */
Array.constains = function( array, v ) {
	return Array.indexOf(array, v) != -1;
};
// 根据数组中的指定元素删除元素 删除成功,返回true,否则false
Array.removeByValue = function( array, o ) {
	var inx = Array.indexOf(array, o );
	if ( inx != -1 ){
		array.splice( inx, 1 );
		return true;
	} else {
		return false;
	}
};
// 向数组中添加一个value,如果已存在,则不操作 添加成功,返回true,否则false
Array.add = function( array, o ) {
	var inx = Array.indexOf(array, o );
	if ( inx == -1 ){
		array.push(o);
		return true;
	} else {
		return false;
	}
};
/* 对象是否包含某个对象 */
Object.constains = function( obj, v ) {
	for ( var i in obj ) {
		if ( v == obj[i] ) {
			return true;
		}
	}
	return false;
};
// 属性名数组
Object.keys = function( obj ) {
	var keys = new Array();
	for ( var prop in obj ) 
		keys.push( prop );
	return keys;
};
// 对象属性个数
Object.size = function( obj ) {
	var counter = 0;
	for ( var temp in obj ) 
		counter++;
	return counter;
};